ate failed.'=>'Hvis opdateringen gennemføres, vil du den tilhørende besked. Ellers må du kontakt teknisk support, hvis opdateringen fejler.','Wrong Data'=>'Forkerte data','Wrong Nonce'=>'Forkert nonce','%s - Upgrade Process'=>'%s - Opgraderingsproces','empty'=>'tom','Upgrade'=>'Opgrader','%s is a major update, and we highly recommend creating a full backup of your site before updating.'=>'%s er en større opdatering, og vi anbefaler kraftigt at lave en komplet sikkerhedskopi af dit websted, før du opdaterer.','Re-Activate'=>'Genaktiver','Clear License'=>'Ryd Licens','unknown_error'=>'ukendt_fejl','This appears to be an invalid license key for %s.'=>'Dette ser ud til at være en ugyldig licensnøgle til %s.','Your license key expires on %s.'=>'Din licensnøgle udløber d. %s.','To receive updates, please enter your valid %s license key.'=>'For at modtage opdateringer, udfyld venligst din gyldige %s licensnøgle.','Invalid license. Please <a href="%s" target="_blank">visit your account page</a> and verify it.'=>'Ugyldig licens. <a href="%s" target="_blank">Besøg venligst din kontoside</a>  og verificer den.','Your license key has been disabled. Please <a href="%s" target="_blank">contact support</a> for more information.'=>'Din licensnøgle er blevet deaktiveret. <a href="%s" target="_blank"> Kontakt venligst support</a> for mere information.','License key never expires.'=>'Licensnøgle udløber aldrig.','The key you entered belongs to a bundle, please use the product specific license key.'=>'Den indtastede nøgle gælder for en pakke, brug venligst en produkt-specifik licensnøgle.','Your license key has reached its activation limit. <a href="%s">View possible upgrades</a> now.'=>'Din licensnøgle har nået sin aktiveringsbegrænsning.  <a href="%s">Se mulige opgraderinger</a> nu.','Ultimate Member - Settings'=>'Ultimate Member - Indstillinger','Remove Data on Uninstall?'=>'Fjern data ved afinstallation?','Check this box if you would like Ultimate Member to completely remove all of